import React from "react";
import { Row, Button, Modal, ModalHeader, ModalBody, Form, FormGroup, Label, Input, Alert, Col  } from "reactstrap";
import SubHeader from "../../../component/sub-header";
import PaginationRemote from './../../../component/PaginationRemote/Component';
import moment from "moment";
import Loading from '../../../component/Loading/index'
import { PulseLoader } from "react-spinners";
import { PRIMARY_COLOR } from "../../../config/constant"

export default class Agent extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      mobile: false,
      fetchingListAgent: true
    }
  }

  index=0
  columns = [
    { dataField: "index", text: "NO", headerStyle: { width: "5%" } },
    { dataField: "name", text: "NAME", headerStyle: { width: "15%" } },
    { dataField: "phone",text: "PHONE NUMBER", headerStyle: { width: "20%" } },
    { dataField: "email", text: "EMAIL", headerStyle: { width: "15%" } },
    { dataField: "date", text: "DATE CREATE", headerStyle: { width: "15%" }},
    { dataField: "status", text: "STATUS", headerStyle: { width: "10%" }},
    { dataField: "action", text: "PARENT", headerStyle: { width: "20%" }},
  ];

  renderLoading(){
    return(
      <div className="box-loading" style={{marginTop: 50, marginBottom:50}}>
        <Loading
          type="PulseLoader"
          loading={true}
          color={'#008c9a'}
          size={25}
        />
      </div>
    )
  }

  render() {
    const {mobile, fetchingListAgent} = this.state
    return(
      <div className="section-search">
        <Row className="search-flight-heading bot">List Data Agent</Row>
        <Row className="step-form-table">
          <div style={{ width: "100%" }}>
            <SubHeader title={"List Data Agents"} />
            <div className="form-search" style={mobile ? {overflow:"scroll",width:window.innerWidth-20} : {}}>
              <PaginationRemote tableUser={true}
                searchPlaceholder="Search in Here"
                loading={fetchingListAgent}
                // handleChangeSearch={this.handleChangeSearch.bind(this)}
                // searchValue={params.q}
                data={ "aaaa" }
                columns={this.columns}
                // page={ params.page }
                // sizePerPage={ params.sizePerPage }
                // totalSize={ !meta ? 1 : meta.total }
                // onTableChange={ this.handleTableChange }
              />
            </div>
          </div>
        </Row>
      </div>
    )
  }
}
